import { Link } from 'react-router-dom';
import { Nav } from 'react-bootstrap';

const SideBar = () => {


    return (
        <>
        <AppBar position="static"> 
            <Nav>
            <Nav.Item>
              <Link to="/addEtudiant" style={{color:"white"}}>Ajout</Link>
